import Navigation from '../Components/Navigation'
import "../styles.css"




export default function Event(){
    return(
        <div>
            <Navigation />
            <h2 className='center-text'>Events</h2><br/>
            <a href="/events/volunteerhistory" className="navbutton"><button className='adminredirect'>VolunteerHistory</button></a>
            

        </div>
    )
}
